        possiblyNegativeIndexForCount(
            index: Int(startInclusivePossiblyNegativeAsDouble),
            count: array.count
        )
    let realEndIndexExclusive: Int =
        possiblyNegativeIndexForCount(
            index: Int(endExclusivePossiblyNegative),
            count: array.count
